import './App.css';
import Board from './components/Board'
import Menu from './components/Menu'
import game from './game/game'

function App() {
  return (
    <div className="App">
      <h1 id="titulo">JOGO DA VELHA</h1>
      <div id="container">
        <Board game={game}></Board>
        <Menu game={game}></Menu>
      </div>
    </div>
  );
}

export default App;
